(function () {
  /*** Register plugin in window object */

  this.zeepway = function ({
    api_key,
    amount,
    email,
    name,
    clientRef,
    onClose,
    chargeUser,
  }) {
    //fee
    let fee = (1.5 / 100) * Number(amount);
    if (fee > 2500) fee = 2500;

    //set key
    this.apikey = api_key;
    this.baseUrl = "https://staging-api.zeepjet.com";
    this.details = {
      amount,
      email,
      name,
      clientRef,
    };
    this.onClose = onClose ? onClose : null;
    this.chargeUser = chargeUser ? chargeUser : false;
    this.fee = chargeUser ? fee : 0;

    this.init();
  };

  /*** Public Methods */

  zeepway.prototype.init = function () {
    var payWithCardModal = `
      <div class="zeepway-modal" id="zeepway-modal">
        <div class="zeepway-modal-content">
          <div class="zeepway-modal-close-button" id="zeepway-modal-close-button">
            &#10008;
          </div>
          <div class="zeepway-modal-text">
            <div class="zeepway-wrapper">
              <div class="zeepway-tab-wrapper">
                <div class="zeepway-buttons">
                  <img src="https://res.cloudinary.com/dlujuf4gd/image/upload/v1691394826/ccygrnpxeqcuqvd7toa1.png"
                    alt="logo" class="zeepway-logo" />
                    <div class="zeepway-payment-options">
                  <p>Pay with:</p>
                  <button id="defaultOpen">
                    <img src="https://res.cloudinary.com/dnddetqsi/image/upload/v1708457058/card_wozk0h.svg" alt="card" />
                    Card
                  </button>
                  <button disabled>
                    <img src="https://res.cloudinary.com/dnddetqsi/image/upload/v1708457059/transfer_q9e9vy.svg"
                      alt="transfer" />
                    Transfer
                  </button>
                  <button disabled>
                    <img src="https://res.cloudinary.com/dnddetqsi/image/upload/v1708457059/ussd_dsslpi.svg" alt="ussd" />
                    USSD
                  </button>
                  <button disabled>
                    <img src="https://res.cloudinary.com/dnddetqsi/image/upload/v1708457059/qr_rxavpc.svg" alt="qr scan" />
                    QR SCAN
                  </button>
                  </div>
                </div>
                <div class="zeepway-payment-section">
                <section>
                  <div class="zeepway-payment-header">
                    <div class="payer__details">
                      <div>
                        <p class="amount-header">
                          Pay <span>₦ ${formatMoney(this.details.amount)}</span>
                        </p>
                        ${
                        this.fee > 0
                        ? `<p style="color: red;">
                          Fee <span style="color: red;">₦ ${formatMoney(
                            this.fee
                            )}</span>
                        </p>`
                        : ""
                        }
                      </div>
                      <div>
                        <p class="email-header">${this.details.email}</p>
                      </div>
                    </div>
                  </div>
                  <div class="tab__content" id="zeepwayCardSection">
                    <div class="card__details">
                      <div id="cardDetails">
                        <div class="zeepway-card_wrapper">
                          <p>Enter your card details to pay</p>
                          <label for="card">Card Number</label>
                          <div class="card_input">
                            <input type="text" id="cardInput" class="test_card" ref="card_input" />
                            <img src="" class="visa card__img" id="cardImg" />
                          </div>
                        </div>
                        <div class="input">
                          <div class="expiry">
                            <label for="expiry">Expiry Date</label>
                            <input type="text" id="expiry" class="date" />
                          </div>
                          <div class="cvv">
                            <label for="cvv">CVV</label>
                            <input type="password" id="cvv" />
                          </div>
                        </div>
                        <div class="button">
                          <button id="makePaymentZeepway">
                            <div class="zeepwayBtnContent">
                              <span id="zeepwaySpinner" class="zeepwaySpinner">
                              </span>
                              Next
                            </div>
                          </button>
                          <div id="zeepwayErrorDiv"></div>
                        </div>
                      </div>
                    </div>
                  </div>
                  <div id="zeepwayPinDiv" class="zeepway_card_hide">
                    <label class="zeepway_pin_label" for="zeepwayCardPin">Enter your card pin</label>
                    <input type="password" id="zeepwayCardPin" class="test_card zeepway_card_pin" />
                  </div>
                  <div id="zeepwayOtpDiv" class="zeepway_card_hide">
                    <label class="zeepway_otp_label" for="zeepwayOtpPin">Enter the OTP sent to you</label>
                    <input type="password" id="zeepwayOtpPin" class="test_card zeepway_otp_pin" />
                    <button type="submit" id="zeepwayOtpSubmit" class="zeepway_submit_button">
                      Pay ₦${formatMoney(
                      Number(this.details.amount) + Number(this.fee)
                      )}
                    </button>
                  </div>
                  <div id="zeepwaySuccess" class="zeepway_card_hide">
                    <div class="zeepway_result_container" id="resultContainer">
                      <div class="zeepway_icon" id="resultIcon"></div>
                      <p id="resultHeading" class="resultHeading"></p>
                      <p id="resultMessage"></p>
                    </div>
                  </div>
                  <div id="zeepwayLoading" class="zeepwayLoadingContentHide">
                    <div class="zeepway-loading"></div>
                  </div>
                </section>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
          `;

    var mainDiv = document.createElement("div");
    // mainDiv .setAttribute("id", "zeepway-modal-slot");
    mainDiv.className = "zeepway-main-element";
    mainDiv.innerHTML = payWithCardModal;
    document.body.appendChild(mainDiv);

    function resetToInitialState() {
      const pinStage = document.getElementById("zeepwayPinDiv");
      const otpStage = document.getElementById("zeepwayOtpDiv");
      const tabContent = document.getElementById("zeepwayCardSection");

      if (pinStage) pinStage.style.display = "none";
      if (otpStage) otpStage.style.display = "none";
      if (tabContent) tabContent.style.display = "block";
    }

    document
      .getElementById("zeepway-modal-close-button")
      .addEventListener("click", () => {
        document
          .getElementById("zeepway-modal")
          .classList.remove("zeepway-show-modal");

        // Manually clear input fields
        const cardInput = document.getElementById("cardInput");
        const cardImg = document.getElementById("cardImg");
        const expiryInput = document.getElementById("expiry");
        const cvvInput = document.getElementById("cvv");
        const cardPinInput = document.getElementById("zeepwayCardPin");
        const otpInput = document.getElementById("zeepwayOtpPin");

        if (cardInput) cardInput.value = "";
        if (cardImg) cardImg.src = "";
        if (expiryInput) expiryInput.value = "";
        if (cvvInput) cvvInput.value = "";
        if (cardPinInput) cardPinInput.value = "";
        if (otpInput) otpInput.value = "";

        resetToInitialState();
        window.location.reload();
        this.onClose && this.onClose();
      });

      // styling for active button
      const setActiveButton = (buttonId) => {
        document.querySelectorAll('.zeepway-buttons button').forEach(button => {
          button.classList.remove('zeepway-button-active');
        });
        const activeButton = document.getElementById(buttonId);
        if (activeButton) {
          activeButton.classList.add('zeepway-button-active');
        }
      };
      const handlePaymentButtonClick = (event) => {
        const buttonId = event.target.id || event.target.closest('button').id;
        setActiveButton(buttonId);
     };
     document.querySelectorAll('.zeepway-buttons button').forEach(button => {
      button.addEventListener('click', handlePaymentButtonClick);
     });

    document.getElementById("defaultOpen").click();
    const card__img = document.querySelector(".card__img");
    let card;
    let cleave = new Cleave(".test_card", {
      creditCard: true,
      creditCardStrictMode: true,
      onCreditCardTypeChanged: function (type) {
        if (type === "visa") {
          card__img.setAttribute(
            "src",
            "https://res.cloudinary.com/dlujuf4gd/image/upload/v1691395340/visa.1c0dbf0_dk1d4i.png"
          );
        } else if (type === "mastercard") {
          card__img.setAttribute(
            "src",
            "https://res.cloudinary.com/dlujuf4gd/image/upload/v1691395258/mastercard.909b641_jffkxq.svg"
          );
        } else {
          card__img.setAttribute("src", "");
        }
      },
    });

    let cleav = new Cleave(".date", {
      date: true,
      datePattern: ["m", "y"],
    });

    const setCardTypeImage = (cardNumber) => {
      cardNumber = cardNumber.replace(/\s/g, "");

      if (cardNumber.startsWith("50") || cardNumber.startsWith("65")) {
        card__img.setAttribute(
          "src",
          "https://res.cloudinary.com/dlujuf4gd/image/upload/v1694107407/verve_logo_loxu2l.png"
        );
      }
    };

    document
      .getElementById("cardInput")
      .addEventListener("input", function (e) {
        let cardNumber = e.target.value;
        setCardTypeImage(cardNumber);
      });

    document
      .getElementById("makePaymentZeepway")
      .addEventListener("click", () => {
        this.pay();
      });
    // build.call(this);
  };

  zeepway.prototype.start = function () {
    document
      .getElementById("zeepway-modal")
      .classList.add("zeepway-show-modal");
      setActiveButton('defaultOpen');
  };

  function formatMoney(number) {
    return Number(number)
      .toFixed(2)
      .replace(/\d(?=(\d{3})+\.)/g, "$&,");
  }

  zeepway.prototype.pay = function () {
    document.getElementById("zeepwayErrorDiv").innerHTML = "";
    document.getElementById("makePaymentZeepway").disabled = true;

    const card = document.getElementById("cardInput").value;
    const expiry = document.getElementById("expiry").value;
    const cvv = document.getElementById("cvv").value;

    let format = card.split(" ");
    let cardNumber = [...format].join("");
    let monthYear = expiry.split("/");
    const payload = {
      card_number: cardNumber,
      card_expiry_month: monthYear[0],
      card_expiry_year: monthYear[1],
      amount: Number(Number(this.details.amount).toFixed(2)),
      customer_email: this.details.email,
      customer_name: this.details.name,
      currency: "NGN",
      cvv: cvv,
      javaEnabled: navigator.javaEnabled(),
      language: navigator.language,
      screenHeight: screen.height,
      screenWidth: screen.width,
      timeZone: new Date().getTimezoneOffset(),
      colorDepth: screen.colorDepth,
      userAgent: navigator.userAgent,
      charge_user: this.chargeUser,
      client_ref: this.details.clientRef,
    };

    if (
      (card.length < 16 || card.length > 22) &&
      expiry.length !== 5 &&
      cvv.length !== 3
    ) {
      document.getElementById("zeepwayErrorDiv").innerHTML = `
        <p class="zeepwayError">Please fill all required fields!</p>`;
      return;
    }

    document.getElementById("zeepwaySpinner").innerHTML = `
      <svg width="24" height="24" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg"><style>.spinner_P7sC{transform-origin:center;animation:spinner_svv2 .75s infinite linear}@keyframes spinner_svv2{100%{transform:rotate(360deg)}}</style><path fill="#fff" d="M10.14,1.16a11,11,0,0,0-9,8.92A1.59,1.59,0,0,0,2.46,12,1.52,1.52,0,0,0,4.11,10.7a8,8,0,0,1,6.66-6.61A1.42,1.42,0,0,0,12,2.69h0A1.57,1.57,0,0,0,10.14,1.16Z" class="spinner_P7sC"/></svg>
      `;

    fetch(`${this.baseUrl}/v1/transactions/initiate`, {
      method: "POST",
      body: JSON.stringify(payload),
      headers: {
        "Content-type": "application/json; charset=UTF-8",
        public_key: `${this.apikey}`,
      },
    })
      .then((response) => {
        return response.json();
      })
      .then((json) => {
        if (json.status !== "error") {
          if (json.transaction.response_code === "00") {
            document.getElementById("zeepwayCardSection").innerHTML =
              json.data.html;
            eval(document.getElementById("authenticate-payer-script").text);
          }
        } else {
          document.getElementById("zeepwayErrorDiv").innerHTML = `
            <p class="zeepwayError">${json.message}</p>`;
        }
        if (json.status === "SUCCESSFUL" && json.authenticationType === "pin") {
          document
            .getElementById("zeepwayCardSection")
            .classList.add("zeepway_card_hide");
          document
            .getElementById("zeepwayPinDiv")
            .classList.remove("zeepway_card_hide");

          const reference = json.transaction.reference;

          const zeepwayCardPinInput = document.getElementById("zeepwayCardPin");

          zeepwayCardPinInput.addEventListener("input", (event) => {
            const pin = event.target.value;
            if (pin.length === 4) {
              this.chargePin(cardNumber, monthYear, cvv, pin, reference).then(
                (response) => {
                  if (response.status === "SUCCESSFUL") {
                    document
                      .getElementById("zeepwayLoading")
                      .classList.add("zeepwayLoadingContentHide");
                    document
                      .getElementById("zeepwayPinDiv")
                      .classList.add("zeepway_card_hide");
                    document
                      .getElementById("zeepwayOtpDiv")
                      .classList.remove("zeepway_card_hide");
                    let otp;
                    document
                      .getElementById("zeepwayOtpPin")
                      .addEventListener("input", (event) => {
                        otp = event.target.value;
                      });
                    const reference = response.transaction.reference;
                    document
                      .getElementById("zeepwayOtpSubmit")
                      .addEventListener("click", () => {
                        document
                          .getElementById("zeepwayOtpDiv")
                          .classList.add("zeepway_card_hide");
                        document
                          .getElementById("zeepwayLoading")
                          .classList.remove("zeepwayLoadingContentHide");
                        const payload = {
                          otp: otp,
                        };

                        const resultContainer =
                          document.getElementById("resultContainer");
                        const resultIcon =
                          document.getElementById("resultIcon");
                        const resultHeading =
                          document.getElementById("resultHeading");
                        const resultMessage =
                          document.getElementById("resultMessage");

                        fetch(
                          `${this.baseUrl}/v1/transactions/submit-otp/${reference}`,
                          {
                            method: "POST",
                            body: JSON.stringify(payload),
                            headers: {
                              "Content-type": "application/json; charset=UTF-8",
                              public_key: `${this.apikey}`,
                            },
                          }
                        )
                          .then((response) => {
                            return response.json();
                          })
                          .then((OtpJson) => {
                            if (OtpJson.status === "SUCCESSFUL") {
                              document
                                .getElementById("zeepwayLoading")
                                .classList.add("zeepwayLoadingContentHide");
                              document
                                .getElementById("zeepwaySuccess")
                                .classList.remove("zeepway_card_hide");
                              resultContainer.classList.add("zeepway_success");
                              resultIcon.innerHTML = `<svg width="265" height="144" viewBox="0 0 265 144" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                              <rect x="25.036" y="2.87305" width="100" height="100" transform="rotate(14.4341 25.036 2.87305)" fill="url(#pattern0)"/>
                              <rect x="178.02" y="0.472656" width="100" height="100" transform="rotate(29.6916 178.02 0.472656)" fill="url(#pattern1)"/>
                              <rect x="71.7992" y="36.123" width="107" height="107" fill="url(#pattern2)"/>
                              <defs>
                              <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
                              <use xlink:href="#image0_148_3455" transform="scale(0.00195312)"/>
                              </pattern>
                              <pattern id="pattern1" patternContentUnits="objectBoundingBox" width="1" height="1">
                              <use xlink:href="#image0_148_3455" transform="scale(0.00195312)"/>
                              </pattern>
                              <pattern id="pattern2" patternContentUnits="objectBoundingBox" width="1" height="1">
                              <use xlink:href="#image1_148_3455" transform="scale(0.00195312)"/>
                              </pattern>
                              <image id="image0_148_3455" width="512" height="512" xlink:href="data:image/png;base64,"/>
                              <image id="image1_148_3455" width="512" height="512" xlink:href="data:image/png;base64,"/>
                              </defs>
                              </svg>
                              `;
                              resultHeading.textContent = "Successful Payment";
                              resultMessage.innerHTML =
                                "<p> Congratulations, your payment is successful. <br /> Thank you for your payment.</p>";
                              if (OtpJson.transaction.authorization === "pin") {
                                setTimeout(() => {
                                  window.location.href = OtpJson.callbackUrl;
                                }, 300000);
                              }
                            } else {
                              document
                                .getElementById("zeepwayLoading")
                                .classList.add("zeepwayLoadingContentHide");
                              document
                                .getElementById("zeepwaySuccess")
                                .classList.remove("zeepway_card_hide");
                              resultContainer.classList.add("zeepway_failure");
                              resultIcon.innerHTML = `<svg width="131" height="119" viewBox="0 0 131 119" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                              <rect x="24.5" y="19.7979" width="80" height="80" fill="url(#pattern0)"/>
                              <circle cx="33.5" cy="5.79785" r="5" fill="#F15249"/>
                              <circle cx="95.5" cy="5.79785" r="5" fill="#F15249"/>
                              <circle cx="5" cy="5" r="5" transform="matrix(-1 0 0 1 42.5 108.798)" fill="#F15249"/>
                              <circle cx="5" cy="5" r="5" transform="matrix(-1 0 0 1 95.5 108.798)" fill="#F15249"/>
                              <circle cx="5.5" cy="41.7979" r="5" fill="#F15249"/>
                              <circle cx="7.5" cy="86.7979" r="5" fill="#F15249"/>
                              <circle cx="125.5" cy="41.7979" r="5" fill="#F15249"/>
                              <circle cx="123.5" cy="86.7979" r="5" fill="#F15249"/>
                              <defs>
                              <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
                              <use xlink:href="#image0_148_3527" transform="scale(0.00195312)"/>
                              </pattern>
                              <image id="image0_148_3527" width="512" height="512" xlink:href="data:image/png;base64,"/>
                              </defs>
                              </svg>
                              `;
                              resultHeading.textContent = "Payment Failed!";
                              resultMessage.innerHTML = `<p>${OtpJson.message}</p>`;
                            }
                          })
                          .catch((err) => {
                            document
                              .getElementById("zeepwayLoading")
                              .classList.add("zeepwayLoadingContentHide");
                            document
                              .getElementById("zeepwaySuccess")
                              .classList.remove("zeepway_card_hide");
                            resultContainer.classList.add("zeepway_failure");
                            resultIcon.innerHTML = `<svg width="131" height="119" viewBox="0 0 131 119" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                            <rect x="24.5" y="19.7979" width="80" height="80" fill="url(#pattern0)"/>
                            <circle cx="33.5" cy="5.79785" r="5" fill="#F15249"/>
                            <circle cx="95.5" cy="5.79785" r="5" fill="#F15249"/>
                            <circle cx="5" cy="5" r="5" transform="matrix(-1 0 0 1 42.5 108.798)" fill="#F15249"/>
                            <circle cx="5" cy="5" r="5" transform="matrix(-1 0 0 1 95.5 108.798)" fill="#F15249"/>
                            <circle cx="5.5" cy="41.7979" r="5" fill="#F15249"/>
                            <circle cx="7.5" cy="86.7979" r="5" fill="#F15249"/>
                            <circle cx="125.5" cy="41.7979" r="5" fill="#F15249"/>
                            <circle cx="123.5" cy="86.7979" r="5" fill="#F15249"/>
                            <defs>
                            <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
                            <use xlink:href="#image0_148_3527" transform="scale(0.00195312)"/>
                            </pattern>
                            <image id="image0_148_3527" width="512" height="512" xlink:href="data:image/png;base64,"/>
                            </defs>
                            </svg>
                            `;
                            resultHeading.textContent = "Payment Failed!";
                            resultMessage.innerHTML = `<p>${err.message}</p>`;
                          });
                      });
                  }
                }
              );
            }
            if (pin.length > 4) {
              event.target.value = pin.slice(0, 4);
            }
          });
        }
        if (
          json.status === "SUCCESSFUL" &&
          json.authenticationType === "redirect"
        ) {
          const redirectLink = json.redirectUrl;
          window.location.assign(redirectLink);
        }
      })
      .catch((err) => {
        const errorMessage =
          err.response && err.response.data && err.response.data.error
            ? err.response.data.error
            : "Unable to process, please try again";
        document.getElementById("zeepwayErrorDiv").innerHTML = `
        <p class="zeepwayError">${errorMessage}</p>`;
      })
      .finally(() => {
        document.getElementById("zeepwaySpinner").innerHTML = "";
        document.getElementById("makePaymentZeepway").disabled = false;
      });
  };
  zeepway.prototype.chargePin = function (
    cardNumber,
    monthYear,
    cvv,
    pin,
    reference
  ) {
    document
      .getElementById("zeepwayLoading")
      .classList.remove("zeepwayLoadingContentHide");
    document
      .getElementById("zeepwayLoading")
      .classList.add("zeepwayLoadingContent");
    document.getElementById("zeepwayPinDiv").classList.add("zeepway_card_hide");
    const payload = {
      card_number: cardNumber,
      card_expiry_month: monthYear[0],
      card_expiry_year: monthYear[1],
      cvv: cvv,
      amount: Number(Number(this.details.amount).toFixed(2)),
      customer_email: this.details.email,
      customer_name: this.details.name,
      pin: pin,
    };
    return new Promise((resolve, reject) => {
      fetch(`${this.baseUrl}/v1/transactions/charge-pin/${reference}`, {
        method: "POST",
        body: JSON.stringify(payload),
        headers: {
          "Content-type": "application/json; charset=UTF-8",
          public_key: `${this.apikey}`,
        },
      })
        .then((response) => response.json())
        .then((chargeJson) => {
          resolve(chargeJson);
        })
        .catch((err) => {
          reject(err);
        });
    });
  };
})();
